import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import Index from "./pages/index";

function App() {
  return (
    <div className="container">

    <Provider store={store}>
      <div>Hola</div>
      <Index />
    </Provider>
    </div>
  );
}

export default App;
